use std::thread;
use std::time::Duration;
use termion::clear;
use termion::cursor;
use termion::raw::IntoRawMode;

struct Snake {
    x: i32,
    y: i32,
}

impl Snake {
    fn new() -> Self {
        Snake { x: 0, y: 0 }
    }

    fn move_left(&mut self) {
        self.x -= 1;
    }

    fn move_right(&mut self) {
        self.x += 1;
    }

    fn move_up(&mut self) {
        self.y -= 1;
    }

    fn move_down(&mut self) {
        self.y += 1;
    }
}

fn main() {
    let stdout = std::io::stdout().into_raw_mode().unwrap();
    let mut snake = Snake::new();

    loop {
        println!("{}{}O", cursor::Goto(snake.x, snake.y), clear::CurrentLine);
        thread::sleep(Duration::from_millis(100));
        snake.move_right();
    }
}
```
