To iterate through each item in an array in a random order using C++, you can use the _Fisher-Yates_ shuffle algorithm.

Here is an example implementation:

```cpp
#include <iostream>
#include <cstdlib>
#include <ctime>

using namespace std;

void shuffle(int arr[], int size) {
    srand(time(NULL)); // initialize random seed

    for (int i = size - 1; i >= 1; i–) {
        int j = rand() % (i + 1); // generate a random index between 0 and i
        swap(arr[i], arr[j]); // swap the elements at indices i and j
    }
}

int main() {
    int arr[] = {1, 2, 3, 4, 5, 6};
    int size = sizeof(arr) / sizeof(arr[0]); // obtain the size of the array

    shuffle(arr, size); // shuffle the array elements

    // iterate through the shuffled array
    for (int i = 0; i < size; i++) {
        cout << arr[i] << " ";
    }
    cout << endl;

    return 0;
}
```

In this implementation, the `shuffle()` function takes an array and its size as input and rearranges the elements in the array in a random order using the Fisher-Yates algorithm. The `main()` function calls `shuffle()` to shuffle the arr array and then iterates through the shuffled array using a for-loop to print out each element.

The results of the program will be different each time it is run due to the random nature of the shuffle algorithm.

One solution to achieve this would be to use a reverse proxy like Nginx. You can set up Nginx in front of both your frontend and backend Docker containers, and then configure it to route requests to the correct container based on the URL. This would allow you to dynamically change the backend URL in your frontend code, and have Nginx route requests accordingly.

To do this, you would need to modify your docker-compose files to expose the ports for your frontend and backend containers to the host machine. Then, you can set up an Nginx container and mount a configuration file into it that specifies the routes to your frontend and backend containers. Within this configuration file, you can set up a proxy_pass directive that forwards requests to the appropriate backend container based on the URL path.

For example, your Nginx configuration file might look something like this:

```bash
server {
    listen 80;
    server_name example.com;

    location /api {
        proxy_pass http://backend:8000;
    }

    location / {
        proxy_pass http://frontend:3000;
    }
}
```

In this example, Nginx is configured to route requests to /api to the backend container at http://backend:8000, and all other requests to the frontend container at http://frontend:3000. You can then modify your frontend code to make requests to the /api path, and Nginx will route them to the correct backend container.

By using Nginx as a reverse proxy, you can dynamically change the backend URL in your frontend code without having to rebuild your production image. This provides a more elegant and scalable solution for managing your application's configuration.

